import React, { Fragment } from 'react';
import { makeStyles } from "@material-ui/core/styles";
import styles from "assets/jss/material-kit-react/views/loginPage.js";
import Header from 'components/Header/Header';
import HeaderLinks from 'components/Header/HeaderLinks';
import GridContainer from 'components/Grid/GridContainer';
import GridItem from 'components/Grid/GridItem';
import { Button, Input } from '@material-ui/core';

import './ProfesionalesPreview.style.scss';
import CustomInput from 'components/CustomInput/CustomInput';
import Card from 'components/Card/Card';
import CardHeader from 'components/Card/CardHeader';
import CardFooter from 'components/Card/CardFooter';
import CardBody from 'components/Card/CardBody';

const useStyles = makeStyles(styles);


const ProfesionalesPreview = (props) => {
    const classes = useStyles();

    const [cardAnimaton, setCardAnimation] = React.useState("cardHidden");
        setTimeout(function () {
        setCardAnimation("");
    }, 700);

    const { ...rest } = props;

    return (
        <>
          <Header
            fixed
            color="white"
            brand=""
            rightLinks={<HeaderLinks />}
            {...rest}
          />

<div
        className={classes.pageHeader}
        style={{
          backgroundColor: "white",
          backgroundSize: "cover",
          backgroundPosition: "top center"
        }}
      >
          <div className={classes.container}>
          <GridContainer justify="center">
            <GridItem xs={12} sm={12} md={3}>
              <h4 className="titulo4">PREPARA TU ENTREVISTA</h4>              
              <span className="span">Profesionales a tu disposición</span>
            </GridItem>
            <GridItem xs={12} sm={12} md={9}>
            <label id="color">Filtrar por:</label>
              <div className="filtrar">               
                <CustomInput
                    labelText="Sector"
                    id="sector"
                    formControlProps={{
                        fullWidth: false
                    }}
                    inputProps={{
                        type: "text",                        
                        autoComplete: "on"
                    }}
                />

                <CustomInput
                    labelText="Precio"
                    id="precio"
                    formControlProps={{
                        fullWidth: false
                    }}
                    inputProps={{
                        type: "text",                        
                        autoComplete: "on"
                    }}
                />

<               CustomInput
                    labelText="Idioma"
                    id="idioma"
                    formControlProps={{
                        fullWidth: false
                    }}
                    inputProps={{
                        type: "text",                        
                        autoComplete: "on"
                    }}
                />

                <CustomInput
                    labelText="Tipo"
                    id="tipo"
                    formControlProps={{
                        fullWidth: false
                    }}
                    inputProps={{
                        type: "text",                        
                        autoComplete: "on"
                    }}
                />

                <CustomInput
                    labelText="Hashtag"
                    id="hashtag"
                    formControlProps={{
                        fullWidth: false
                    }}
                    inputProps={{
                        type: "text",                        
                        autoComplete: "on"
                    }}
                />                    
              </div>




              <GridItem xs={12} sm={12} md={4}>
              <Card className={classes[cardAnimaton]}>
                <form className={classes.form}>
                  <CardHeader color="primary" className={classes.cardHeader}>
                    <h4>Crea tu perfil</h4>
                    <div className={classes.socialLine}>
                      <Button
                        justIcon
                        href="#pablo"
                        target="_blank"
                        color="transparent"
                        onClick={e => e.preventDefault()}
                      >
                        <i className={"fab fa-twitter"} />
                      </Button>
                      <Button
                        justIcon
                        href="#pablo"
                        target="_blank"
                        color="transparent"
                        onClick={e => e.preventDefault()}
                      >
                        <i className={"fab fa-facebook"} />
                      </Button>
                      <Button
                        justIcon
                        href="#pablo"
                        target="_blank"
                        color="transparent"
                        onClick={e => e.preventDefault()}
                      >
                        <i className={"fab fa-google-plus-g"} />
                      </Button>
                    </div>
                  </CardHeader>
                  <p className={classes.divider}>O inscripción vía email</p>
                  <CardBody>
                    <CustomInput
                      labelText="Nombre..."
                      id="first"
                      formControlProps={{
                        fullWidth: true
                      }}
                      inputProps={{
                        type: "text",
                        
                      }}
                    />
                    <CustomInput
                      labelText="Apellidos..."
                      id="last"
                      formControlProps={{
                        fullWidth: true
                      }}
                      inputProps={{
                        type: "text",
                        
                      }}
                    />
                    <CustomInput
                      labelText="Email..."
                      id="email"
                      formControlProps={{
                        fullWidth: true
                      }}
                      inputProps={{
                        type: "email",
                        
                      }}
                    />
                    <CustomInput
                      labelText="Password"
                      id="pass"
                      formControlProps={{
                        fullWidth: true
                      }}
                      inputProps={{
                        type: "password",
                        
                        autoComplete: "off"
                      }}
                    />
                  </CardBody>
                  <CardFooter className={classes.cardFooter}>
                    <Button simple color="primary" size="lg">
                      Inscríbete
                    </Button>
                  </CardFooter>
                </form>
              </Card>
            </GridItem>


            </GridItem>
            </GridContainer>
      </div></div>

         </> )



}

export default ProfesionalesPreview
